function setTimeFormat(s) {
	var minute = parseInt(parseInt(s) / 60) + "";
	var second = (parseInt(s) - (parseInt(parseInt(s) / 60)) * 60) + "";
	if (minute < 10) {
		minute = "0" + minute;
	}
	if (second < 10) {
		second = "0" + second;
	}
	return (minute + ":" + second);
}
